/** defaults used on add/edit configuration */
export const defaultDbConfigs = {
  // id: '', - auto generated
  // db_port: '', - optional
  name: '',
  description: '',
  type: '',
  enabled: true,
  db_server: '',
  db_name: '',
  db_username: '',
  db_password: '',
  db_connection_string: '',
  default: false,
}
